import { ReactComponent as GithubIcon } from '../../assets/img/github.svg';

function Navbar() {
    return (
        <header>
            <nav>
                <h1>DSMovie</h1>
                <a href="https://github.com/marcosrohloff" target="_blank" rel="noreferrer"></a>
                <div>
                    <GithubIcon />
                    <p className="dsmovie-contact-link">/devsuperior</p>
                </div>
            </nav>
        </header>
    );
}
export default Navbar;
